<!DOCTYPE html>
<html lang="pt-br">
<head>
    <meta charset="UTF-8">
    <title>Teste Titulo e Thumb - YouTube Mobile</title>
    <style>
        body {
            background-color: #0f0f0f;
            color: #ffffff;
            font-family: "Roboto", Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 20px;
        }
        .container {
            width: 420px;
            background-color: #0f0f0f;
            border-radius: 10px;
            padding: 20px 0;
        }
        textarea, input[type="file"] {
            width: 100%;
            margin-bottom: 15px;
            padding: 12px;
            font-size: 18px;
            border-radius: 5px;
            border: none;
            background-color: #222;
            color: white;
            box-sizing: border-box;
        }
        .thumbnail {
            width: 100%;
            height: 236px;
            object-fit: cover;
            border-radius: 8px;
            border: 1px solid #333;
            cursor: pointer;
        }
        .video-info {
            display: flex;
            align-items: flex-start;
            margin-top: 10px;
            padding: 0 12px;
        }
        .channel-avatar {
            width: 36px;
            height: 36px;
            border-radius: 50%;
            flex-shrink: 0;
            margin-right: 12px;
            object-fit: cover;
            border: 1px solid #333;
        }
        .text-info {
            flex: 1;
        }
        .title {
            font-size: 17px;
            font-weight: 500;
            line-height: 22px;
            max-height: 44px;
            overflow: hidden;
            text-overflow: ellipsis;
            display: -webkit-box;
            -webkit-line-clamp: 2;
            -webkit-box-orient: vertical;
            margin-bottom: 5px;
        }
        .meta {
            font-size: 14px;
            color: #aaaaaa;
        }
        .contador-result {
            font-size: 15px;
            color: #aaa;
            margin-bottom: 8px;
            text-align: right;
        }
        .avisos {
            font-size: 14px;
            margin-bottom: 15px;
        }
        .aviso-ok { color: #00ff88; }
        .aviso-alerta { color: #ffcc00; }
        .aviso-excedeu { color: #ff4444; }
        button {
            padding: 12px 24px;
            font-size: 16px;
            border-radius: 5px;
            border: none;
            background-color: #444;
            color: white;
            cursor: pointer;
            margin-top: 35px;
        }
        button:hover {
            background-color: #666;
        }
    </style>
</head>

    <script>
        const titleInput = document.getElementById('titleInput');
        const charCount = document.getElementById('charCount');
        const wordCount = document.getElementById('wordCount');
        const titlePreview = document.getElementById('titlePreview');
        const imageInput = document.getElementById('imageInput');
        const thumbnailPreview = document.getElementById('thumbnailPreview');
        const limparBtn = document.getElementById('limparBtn');
        const mobileAviso = document.getElementById('mobileAviso');
        const youtubeAviso = document.getElementById('youtubeAviso');

        function atualizarAvisos(len) {
            if (len <= 60) {
                mobileAviso.textContent = "Dentro do ideal para Mobile (até 60)";
                mobileAviso.className = "aviso-ok";
            } else if (len <= 80) {
                mobileAviso.textContent = "Atenção: Pode começar a cortar no Mobile (60+)";
                mobileAviso.className = "aviso-alerta";
            } else {
                mobileAviso.textContent = "Alerta: Provável corte visível no Mobile!";
                mobileAviso.className = "aviso-excedeu";
            }

            if (len <= 100) {
                youtubeAviso.textContent = "Dentro do limite do YouTube (até 100)";
                youtubeAviso.className = "aviso-ok";
            } else {
                youtubeAviso.textContent = "Excedeu o limite máximo do YouTube!";
                youtubeAviso.className = "aviso-excedeu";
            }
        }

        titleInput.addEventListener('input', function() {
            const texto = this.value;
            const len = texto.length;
            charCount.textContent = len;
            wordCount.textContent = texto.trim() === "" ? 0 : texto.trim().split(/\s+/).length;
            titlePreview.textContent = texto;
            atualizarAvisos(len);
        });

        imageInput.addEventListener('change', function() {
            const file = this.files[0];
            if (file) {
                const reader = new FileReader();
                reader.onload = function(e) {
                    thumbnailPreview.src = e.target.result;
                }
                reader.readAsDataURL(file);
            }
        });

        thumbnailPreview.addEventListener('click', function() {
            imageInput.click();
        });
